import React from 'react';
import ContactForm from '..components/ContactForm';

const Contact = () => {
  return (
    <section className="contact">
      <h1>Contact</h1>
      <p>Feel free to reach out using the form below:</p>
      <ContactForm />
    </section>
  );
};

export default Contact;
